r(v,R,i,nn) = ∑(v[i,k]*R[k] for k=1:nn)
q(v,Q,i,nn) = ∑(v[i,k]*Q[k] for k=1:nn)
V(v,R,x,i::Int,n::Int,nn) = r(v,R,i,nn)/∑(r(v,R,j,nn)*x[j] for j=1:n)
V1(v,R,x,i::Int,n::Int,nn) = r(v,R,i,nn)^(3/4) /∑((r(v,R,j,nn)^(3/4))*x[j] for j=1:n)
F(v,Q,x,i::Int,n::Int,nn) = q(v,Q,i,nn)/∑(q(v,Q,j,nn)*x[j] for j=1:n)
e(v,Q,k,i,nn) = v[i,k]*Q[k]/q(v,Q,i,nn)
τ(aₙₘ,bₙₘ,cₙₘ,T::Quantity,mm,k) = exp(-(aₙₘ[mm,k]+bₙₘ[mm,k]*T+cₙₘ[mm,k]*T*T)/T)
τ(aₙₘ,bₙₘ,cₙₘ,T::Number,mm,k) = exp(-ustrip((aₙₘ[mm,k]+bₙₘ[mm,k]*T+cₙₘ[mm,k]*T*T))/T)
β(v,Q,aₙₘ,bₙₘ,cₙₘ,T,i,k,nn) = ∑(e(v,Q,mm,i,nn)*τ(aₙₘ,bₙₘ,cₙₘ,T,k,mm) for mm=1:nn)
θ(v,Q,x,k,n,nn) = ∑(x[i]*q(v,Q,i,nn)*e(v,Q,k,i,nn) for i=1:n)/∑(x[j]*q(v,Q,j,nn) for j=1:n)
s(v,Q,x,aₙₘ,bₙₘ,cₙₘ,T,k,n,nn) = ∑(θ(v,Q,x,mm,n,nn)*τ(aₙₘ,bₙₘ,cₙₘ,T,k,mm) for mm=1:nn)
γᶜ(v,Q,R,x,i::Int,n::Int,nn) = 1-V1(v,R,x,i,n,nn)+log(V1(v,R,x,i,n,nn))-5*q(v,Q,i,nn)*(1-V(v,R,x,i,n,nn)/F(v,Q,x,i,n,nn) +log(V(v,R,x,i,n,nn)/F(v,Q,x,i,n,nn)))
γᴿ(v,Q,x,aₙₘ,bₙₘ,cₙₘ,T,i,n,nn) = q(v,Q,i,nn)*(1-∑(θ(v,Q,x,k,n,nn)*β(v,Q,aₙₘ,bₙₘ,cₙₘ,T,i,k,nn)/s(v,Q,x,aₙₘ,bₙₘ,cₙₘ,T,k,n,nn)-e(v,Q,k,i,nn)*log(β(v,Q,aₙₘ,bₙₘ,cₙₘ,T,i,k,nn)/s(v,Q,x,aₙₘ,bₙₘ,cₙₘ,T,k,n,nn)) for k=1:nn))
γ(v,Q,R,x,aₙₘ,bₙₘ,cₙₘ,T,i,n,nn) = exp(γᶜ(v,Q,R,x,i,n,nn)+γᴿ(v,Q,x,aₙₘ,bₙₘ,cₙₘ,T,i,n,nn))
Po(v,Q,R,x,aₙₘ,bₙₘ,cₙₘ,CA,T,i,n,nn) = x[i]*γ(v,Q,R,x,aₙₘ,bₙₘ,cₙₘ,T,i,n,nn)*general.P_Antoine(CA,T,i)
Pₜₒₜ(v,Q,R,x,aₙₘ,bₙₘ,cₙₘ,CA,T,n,nn) = ∑(Po(v,Q,R,x,aₙₘ,bₙₘ,cₙₘ,CA,T,i,n,nn) for i=1:n)
y_calc(v,Q,R,x,aₙₘ,bₙₘ,cₙₘ,CA,T,i,n,nn)=Po(v,Q,R,x,aₙₘ,bₙₘ,cₙₘ,CA,T,i,n,nn)/Pₜₒₜ(v,Q,R,x,aₙₘ,bₙₘ,cₙₘ,CA,T,n,nn)

"""
    pxy(n,T,CA,com,xx;uni=u"Torr")

**Los campos de entrada son:**
- `n :: Int` Es el numero de componentes
- `T :: Float` Es la temperatura del sistema
- `CA :: n×3 Array{Float,2}` Constantes de Antoine para los `n` componentes
- `com :: `
- `xx :: StepRange ó Vector` Son los puntos en el liquido donde se buscara el equilibrio con el vapor
- `uni` Son las unidades en las que se desea el resultado, por defecto esta en Torr

**Salida:**

Regresa las fracciones de liquido `x`,
las fracciones del vapor `y` y la presión `P` en Torr (`m` es la longitud de `xx`).

- `x :: n×m Array{Float64,2}` liquido
- `y :: n×m Array{Float64,2}` vapor
- `P :: m-element Array{Float64,1}` presión
"""
function pxy(n::Int,T,CA::Array,com::Array,xx...;uni=u"Torr")
    T = T|> u"K"
    xx = general.nc(xx...)
    m = size(xx,2)
    m1 = size(com,2)
    com1 = Set{String}()
    for i=1:m1
        for j=1:n
            if typeof(com[j,i])==Int
                #v[j,i] = 0
            else
                #v[j,i] = com[j,i].frecuencia
                push!(com1,com[j,i].nombre)
            end
        end
    end
    n2 = length(com1)
    v = zeros(n,n2)
    com1 = collect(com1)
    R = Vector{Float64}(undef,n2)
    Q = Vector{Float64}(undef,n2)
    gru = Vector{Int8}(undef,n2)
    for i=1:n2
        R[i],Q[i] = dic1[com1[i]]
        gru[i] = dic[com1[i]][1]
        for j=1:m1, k=1:n
            if typeof(com[k,j])==Int
                v[k,j] = 0
            elseif com[k,j].nombre==com1[i]
                v[k,i] = com[k,j].frecuencia
            end
        end
    end
    a = Array{Float64}(undef,n2,n2)*u"K"
    b = Array{Float64}(undef,n2,n2)
    c = Array{Float64}(undef,n2,n2)*u"1/K"
    for i=1:n2, j=1:n2
        a[j,i] = aₙₘ[gru[i],gru[j]]
        b[j,i] = bₙₘ[gru[i],gru[j]]
        c[j,i] = cₙₘ[gru[i],gru[j]]
    end

    y = Array{Float64}(undef,n,m)
    P = Vector{Float64}(undef,m)*uni
    for i=1:m
        x = xx[:,i]
        for j=1:n
            y[j,i] = y_calc(v,Q,R,x,a,b,c,CA,T,j,n,n2)
        end
        P[i] = Pₜₒₜ(v,Q,R,x,a,b,c,CA,T,n,n2) |> uni
    end
    
    return xx,y,P
    
end

"""
    txy(n,Pobj,CA,com,xx;uni=u"K")

**Los campos de entrada son:**
- `n :: Int` Es el numero de componentes
- `Pobj :: Float` Es la presión del sistema
- `CA :: n×3 Array{Float,2}` Constantes de Antoine para los `n` componentes
- `com :: `
- `xx :: StepRange ó Vector` Son los puntos en el liquido donde se buscara el equilibrio con el vapor
- `uni` Son las unidades en las que se desea el resultado, por defecto esta en grados kelvin

**Salida:**

Regresa las fracciones de liquido `x`,
las fracciones del vapor `y` y la temperatura `T` en grados kelvin (`m` es la longitud de `xx`).

- `x :: n×m Array{Float64,2}` liquido
- `y :: n×m Array{Float64,2}` vapor
- `T :: m-element Array{Float64,1}` temperatura
"""
function txy(n::Int,Pobj,CA::Array,com::Array,xx...;uni=u"K")
    Pobj = Pobj |> u"Torr"
    xx = general.nc(xx...)
    m = size(xx,2)
    m1 = size(com,2)
    com1 = Set{String}()
    for i=1:m1
        for j=1:n
            if typeof(com[j,i])==Int
                #v[j,i] = 0
            else
                #v[j,i] = com[j,i].frecuencia
                push!(com1,com[j,i].nombre)
            end
        end
    end
    n2 = length(com1)
    v = zeros(n,n2)
    com1 = collect(com1)
    R = Vector{Float64}(undef,n2)
    Q = Vector{Float64}(undef,n2)
    gru = Vector{Int8}(undef,n2)
    for i=1:n2
        R[i],Q[i] = dic1[com1[i]]
        gru[i] = dic[com1[i]][1]
        for j=1:m1, k=1:n
            if typeof(com[k,j])==Int
                v[k,j] = 0
            elseif com[k,j].nombre==com1[i]
                v[k,i] = com[k,j].frecuencia
            end
        end
    end
    a = Array{Float64}(undef,n2,n2)*u"K"
    for i=1:n2, j=1:n2
        a[j,i] = aₙₘ[gru[i],gru[j]]
    end
    y = Array{Float64}(undef,n,m)
    T = Vector{Float64}(undef,m)*u"K"
    Tᵢ = 300.0
    #temperatura inicial
    for i=1:n
        if xx[i,1]==1
            T[1] = general.T_Antoine(CA,Pobj,i)
            Tᵢ  = ustrip(u"K",T[1])
        end
    end
    for i = 1:m
        x = xx[:,i]
        P2ₜₒₜ(T) = Pₜₒₜ(v,Q,R,x,a,CA,T,n,n2) - ustrip(u"Torr",Pobj)
        #println(i)
        Pₛₒₗ = nlsolve(n_ary(P2ₜₒₜ),[Tᵢ])
        Tᵢ = Pₛₒₗ.zero[1]
        T[i] = Tᵢ*u"K"
        for j = 1:n
            y[j,i] = y_calc(v,Q,R,x,a,CA,T[i],j,n,n2)
        end
    end

    return xx,y,T .|> uni
end

